import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Header from "./Header";
import Footer from "./Footer";
import CreateNode from "./CreateNode";
import Note from "./Note";
const App=()=>{
  return(
    <>
      <Header />
      <Note />
      <CreateNode />
      <Footer />
    </>
    
  );
}
export default App;
